		"text": "[블라인드티켓 매진]\n⠀⠀⠀\n'그린플러그드 서울 2020' 블라인드티켓이 매진되었습니다. 관심과 성원에 감사드립니다.\n\n취소표 재오픈 예정은 없으며, 개별 취소표 발생시에는 예매가 가능합니다. (1월 20일까지) 취소표 외에 티켓구매를 원하시는 분들은 1월 20일 슈퍼얼리버드티켓을 기다려주세요! https://t.co/94xnE623aw"
